import { useEffect, useState } from 'react';
import OneThumbnail from './OneThumbnail';
import classes from './WebPage2.module.css';
import { getInDb } from './Api';

const WebPage2 = () => {
    const [allFolders , setFolders] = useState(null);
    useEffect(()=>{
        getInDb(setFolders());
    },[])
    return(
        <div className={classes.mainContainer}>
            <div className={classes.innerContainer}>
                {
                    allFolders!==null && allFolders.map((index,oneItem)=>{
                        <OneThumbnail 
                            key={index}
                            item={oneItem}
                        />
                    })
                }
            </div>
        </div>
    )
}

export default WebPage2;
